import {Table} from "react-bootstrap";

const Grid = (props) => {

    let data = [{
        title: 'Test',
        description: 'Test',
        privacy: 'public',
        contactNumber: '',
        technologyUsed: '',
        startDate: '',
        endDate: '',
        status: ''
    }];

    const headers = ['Title', 'Description', 'Privacy', 'Contact Number', 'Tech Used', 'Start Date', 'End Date', 'Status']

    const keys = Object.keys(data[0]);

    return (

        <>
            <Table bordered hover responsive>

                <thead>
                <tr>
                    {
                        headers.map((key, index) => (
                            <th id={index}> {key}</th>
                        ))
                    }
                </tr>
                </thead>
                <tbody>

                {
                    props.data.map((project, index) => (
                        <tr>
                            {
                                keys.map((key, index) => (
                                    <td> { project[key]}</td>
                                ))
                            }
                        </tr>
                    ))
                }
                </tbody>
            </Table>
        </>
    )

}

export default Grid;
